import React from "react";


const profiles = [
  { name: "Jane Doe", role: "UI & UX Designer", img: "https://images.pexels.com/photos/1845208/pexels-photo-1845208.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" },
  { name: "Alex Smith", role: "CEO Expert", img: "https://images.pexels.com/photos/36469/woman-person-flowers-wreaths.jpg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" },
  { name: "Emily New", role: "Web Designer", img: "https://images.pexels.com/photos/1468379/pexels-photo-1468379.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" },
  { name: "Lisa Boley", role: "Marketing Coordinator", img: "https://images.pexels.com/photos/247322/pexels-photo-247322.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=750&w=1260" }
];

const ProfileCards = () => {
  return (
    <div className="flex w-full h-screen items-center justify-center bg-[#100721] p-10">
      {/* Left Text Container */}
      <div className="w-1/3 text-white text-lg font-mono p-5">
        <h1 className="text-3xl font-bold mb-4">Meet Our Team</h1>
        <p>We are a group of professionals dedicated to bringing innovation and creativity to the digital world. Hover over each profile to learn more about our team members.</p>
      </div>

      {/* Right Profile Container */}
      <div className="w-2/3 flex justify-center gap-3 h-[500px]">
        {profiles.map((profile, index) => (
          <div
            key={index}
            className="flex-1 min-w-[120px] rounded-lg transition-all duration-500 cursor-pointer shadow-lg relative overflow-hidden hover:min-w-[250px] hover:shadow-purple-500 hover:-translate-y-4"
            style={{ backgroundImage: `url(${profile.img})`, backgroundSize: "cover", backgroundPosition: "center" }}
          >
            <div className="absolute bottom-0 w-full p-4 bg-gradient-to-t from-[#02022e] to-transparent opacity-0 translate-y-full transition-all duration-500 delay-200 visibility-hidden hover:opacity-100 hover:translate-y-0 hover:visible">
              <h2 className="text-white text-xl font-semibold">{profile.name}</h2>
              <span className="text-white text-sm mt-1 block">{profile.role}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProfileCards;
